description:
PHP has it. Java has it. Even JavaScript has it. It's time .NET joined in with support for the ICU Message Format.

How would you format "He found 1 result in 4 categories", or "She found 3 results in 1 category" without bloating your code with a billion if-statements? And when you have to translate it, then what?

How about something like:

var pattern = @"{Gender, select,
  male {He}
  female {She}
  other {They}
} found {ResultCount, plural,
   zero {no results}
   one {one result}
   other {# results}
} in {CategoryCount, plural,
   zero {0 categories}
   one {one category}
   other {# categories}
}.";

var mf = new MessageFormatter();
var result = mf.FormatMessage(pattern, new {
  Gender = "male",
  ResultsCount = 3,
  CategoriesCount = 1
});

Check the README for more information.

SgmlReader for Portable Class Library.
SgmlReader is "SGML" markup language parser, and derived from System.Xml.XmlReader in .NET CLR.
But, most popular usage the "HTML" parser. (It's scraper!!)

/* Use SgmlReader in Html parse mode. */
XDocument document = SgmlReader.Parse(stream);

Done!

